import './Card.css';

const DeepTable = ({ e }) => {
  console.log(e);

  return (
    <>
      <div>{e.position}</div>
      <div>{e.team.name}</div>
      <div>{e.playedGames}</div>
      <div>{e.won}</div>
      <div>{e.draw}</div>
      <div>{e.lost}</div>
      <div>{e.goalsFor}</div>
      <div>{e.goalsAgainst}</div>
      <div>{e.goalDifference}</div>
    </>
  )
};

export default DeepTable;
